   <motion.div whileHover={cardHover} style={card} ><p style={{paddingTop:40}}>滑动及回弹 </p></motion.div>
        </div>
        <div style={{ 
           backgroundImage: `url(${background})`,
           width: 375, 
           height:812, 
           position: 'absolute', 
           top: 0, 
           opacity: 1, 
           zIndex: '-1'
           }}></div>
        </div>

        </Route>

//链接地址

</Switch>
   </Router>


     );
}

export default List;
